      | 370658 -> { ItemTypeData.id= 370658; name= "Council's Modified Repair Tool"; published= false; description= "By projecting a focused harmonic beam into damaged materials, the repair tool channels construction nanites to return the targeted matter to its original state. Its on-board processor interfaces with a forward-facing sensor suite, instantly recognizing vehicles, devices, and personal armor based on microscopic manufacturer's tags. The beam, a bi-channel “hollow laser”, simultaneously acts as both a containment field and transport medium for the nanite swarm, which works to sift unwanted particles from the structure, undo ionization, and reconstruct the atomic patterns of the material.   The repair tool has several design innovations, the most surprising probably being the incorporation of Amarr focusing crystal technology. Beyond that, the device also makes use of an advanced K7 nano static co-processor on par with Caldari planet side missile tracking systems and a 55x5 reverse current power cell configuration rarely used beyond self-sustaining Gallente drone units. The result is an elegant tool combining the best technology from several very different design philosophies."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
