      | 48133 -> { ItemTypeData.id= 48133; name= "Human Containment Facility"; published= false; description= "This rather euphemistically named facility is in reality a prison used by  unsanctioned  slavers to hold the slaves they have seized ready for work in labor camps, or transport on to other facilities or buyers. The Amarr Empire officially disavows such facilities, noting that without the sanction of a named Amarr Holder such slave barracks and attached labor camps are  beyond the law .    The formula that unsanctioned slave and forced labor camps are beyond the law does not always seem to translate into prompt action against what should be considered outlaw gangs by the Amarr authorities. The Minmatar Republic Justice Department charges that the Empire, and in particular the more traditional Royal Houses and Holders, turn a blind eye to the activities of these slaver gangs.    The RJD's anti-slavery forces go so far as to claim that noble houses such as the Ardishapur and Khanid actually support and supply slavers through a network of lesser Holders and contacts with Amarr mercenary companies. The Amarr Empire contemptuously dismisses such claims as  anti-Amarr propaganda from rebel terrorists . Others in the interstellar community suspect that the RJD is not far from the truth in its claims but are constrained by the Yulai Accords and Convention."; marketGroupId= None; groupId= 306; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 300.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 854; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 903; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 456; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 1000000.000000 }; { DogmaAttributeValueData.attributeId = 1927; val